impl Solution {
    pub fn can_make_subsequence(str1: String, str2: String) -> bool {
        let mut i = 0;
        let mut j = 0;
        let str1 = str1.as_bytes();
        let str2 = str2.as_bytes();
        while i < str1.len() && j < str2.len() {
            let a = str1[i];
            let b = str2[j];
            let next_a = if a == b'z' { b'a' } else { a + 1 };
            if a == b || next_a == b {
                i += 1;
                j += 1;
            } else {
                i += 1;
            }
        }
        j == str2.len()
    }
}

struct Solution;

fn main() {
    assert_eq!(
        Solution::can_make_subsequence("abc".to_string(), "ad".to_string()),
        true
    );
    assert_eq!(
        Solution::can_make_subsequence("zc".to_string(), "ad".to_string()),
        true
    );
    assert_eq!(
        Solution::can_make_subsequence("ab".to_string(), "d".to_string()),
        false
    );
    assert_eq!(
        Solution::can_make_subsequence("".to_string(), "".to_string()),
        true
    );
}
